import React from "react";
import NavBar from "./components/navBar";
import { Route, Redirect, Switch } from "react-router-dom";
import Home from "./components/home";
import StartForm from "./components/login/startForm";
import SuccessPage from "./components/successPage";
import Posts from "./components/posts";
import EditPost from "./components/editPost";
import LoginForm from "./components/login/loginForm";
import RegisterForm from "./components/login/registerForm";

function App() {
  return (
    <div>
      <NavBar />
      <Switch>
        <Route path="/start/login" component={LoginForm} />
        <Route path="/start/register" component={RegisterForm} />
        {/* <Route path="/start/:type?" component={StartForm} /> */}
        <Route path="/home/:id?/:action?" component={Home} />
        <Route path="/edit/:postId?" component={EditPost} />
        <Route path="/success" component={SuccessPage} />
        <Route path="/posts/:postId?" component={Posts} />
        <Redirect to="/loading" />
      </Switch>
    </div>
  );
}

export default App;
